import React from "react";
import "./Board.css";
import PostBox from "./postBox";
//PostBox를 그려줍니다.
function PostList({ live, postList, seedetial, goBack }) {
  console.log(postList);
  return (
    <div className="list">
      {postList &&
        postList.map((post, idx) => (
          <React.Fragment key={idx}>
            {post.data.content.length - 1 === idx ? (
              <PostBox
                live={live}
                postList={post.data.content[idx]}
                key={`calendar-week-${post.data.content[idx].id}`}
                seedetail={seedetial}
                goBack={goBack}
              />
            ) : (
              <PostBox postList={post.data.content[idx]} key={`calendar-week-${post.data.content[idx].id}`} seedetail={seedetial} goBack={goBack} />
            )}
          </React.Fragment>
        ))}
    </div>
  );
}
export default PostList;
